          "get_special_conditions_for_the_services_of_our_partners": "\u041F\u043E\u043B\u0443\u0447\u0438\u0442\u0435 <b>\u0441\u043F\u0435\u0446\u0438\u0430\u043B\u044C\u043D\u044B\u0435 \u0443\u0441\u043B\u043E\u0432\u0438\u044F</b> \u043D\u0430 \u0443\u0441\u043B\u0443\u0433\u0438 \u043D\u0430\u0448\u0438\u0445 \u043F\u0430\u0440\u0442\u043D\u0435\u0440\u043E\u0432",
          "see_all_partners": "\u0421\u043C\u043E\u0442\u0440\u0435\u0442\u044C \u0432\u0441\u0435\u0445 \u043F\u0430\u0440\u0442\u043D\u0435\u0440\u043E\u0432",
          "in_which_industry_do_you_need_permits": "\u0412 \u043A\u0430\u043A\u043E\u0439 \u043E\u0442\u0440\u0430\u0441\u043B\u0438 \u0432\u0430\u043C \u043D\u0443\u0436\u043D\u044B <b>\u0440\u0430\u0437\u0440\u0435\u0448\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u044B?</b>",
