          "video_content_from_government_agencies": "\u0412\u0438\u0434\u0435\u043E\u043A\u043E\u043D\u0442\u0435\u043D\u0442 \u043E\u0442 \u0433\u043E\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u0445 \u043E\u0440\u0433\u0430\u043D\u043E\u0432",
          "we_cooperate_with_government_agencies": "\u041C\u044B \u0441\u043E\u0442\u0440\u0443\u0434\u043D\u0438\u0447\u0430\u0435\u043C \u0441 \u0433\u043E\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u043C\u0438 \u043E\u0440\u0433\u0430\u043D\u0430\u043C\u0438 \u0438 \u043D\u0430\u043F\u0440\u044F\u043C\u0443\u044E \u043F\u043E\u043B\u0443\u0447\u0430\u0435\u043C \u043E\u0442 \u043D\u0438\u0445 <b>\u0440\u0430\u0437\u044C\u044F\u0441\u043D\u0435\u043D\u0438\u044F \u043F\u043E \u0442\u0440\u0435\u0431\u043E\u0432\u0430\u043D\u0438\u044F\u043C \u0438 \u043B\u0438\u0446\u0435\u043D\u0437\u0438\u044F\u043C</b> \u0432 \u0444\u043E\u0440\u043C\u0430\u0442\u0435 \u0432\u0438\u0434\u0435\u043E",
          "owner_and_developer_of_the_UPPERLICENSE_product": "\u041F\u0440\u043E\u0434\u0443\u043A\u0442 UPPERLICENSE \u0441\u043E\u0437\u0434\u0430\u043D \u0438 \u0440\u0430\u0437\u0440\u0430\u0431\u043E\u0442\u0430\u043D \u0433\u0440\u0443\u043F\u043F\u043E\u0439 \u043A\u043E\u043C\u043F\u0430\u043D\u0438\u0439 <a href=\"https://uppercase.group\" target=\"_blank\">UPPERCASE</a>",
