          "Medicine": "\u041C\u0435\u0434\u0438\u0446\u0438\u043D\u0430",
          "industry": "\u041F\u0440\u043E\u043C\u044B\u0448\u043B\u0435\u043D\u043D\u043E\u0441\u0442\u044C",
          "bankruptcy_procedure": "\u041F\u0440\u043E\u0446\u0435\u0434\u0443\u0440\u0430 \u0431\u0430\u043D\u043A\u0440\u043E\u0442\u0441\u0442\u0432\u0430",
