          "get_off": "\u041F\u043E\u043B\u0443\u0447\u0438\u0442\u0435 <button class=\"btn-like-href\">\u0441\u043A\u0438\u0434\u043A\u0443 :discount</button> \u043D\u0430 \u043F\u0435\u0440\u0432\u044B\u0439 \u0437\u0430\u043A\u0430\u0437",
          "get_a_discount": "\u041F\u043E\u043B\u0443\u0447\u0438\u0442\u044C \u0441\u043A\u0438\u0434\u043A\u0443",
          "details": "\u041F\u043E\u0434\u0440\u043E\u0431\u043D\u0435\u0435",
          "want_to_become_partner": "\u0425\u043E\u0442\u0438\u0442\u0435 \u0441\u0442\u0430\u0442\u044C \u043F\u0430\u0440\u0442\u043D\u0435\u0440\u043E\u043C UPPERLICENSE?",
          "enter_information_about_your_company_and_we_will_contact_you": "\u0423\u043A\u0430\u0436\u0438\u0442\u0435 \u0438\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0438\u044E \u043E \u0432\u0430\u0448\u0435\u0439 \u043A\u043E\u043C\u043F\u0430\u043D\u0438\u0438 \u0438 \u043C\u044B \u0441\u0432\u044F\u0436\u0435\u043C\u0441\u044F \u0441 \u0432\u0430\u043C\u0438"
