          "which_license_do_you_need": "\u041A\u0430\u043A\u0430\u044F \u043B\u0438\u0446\u0435\u043D\u0437\u0438\u044F \u0432\u0430\u043C \u043D\u0443\u0436\u043D\u0430?",
