              "data3": "\u0412 \u044D\u0442\u043E\u0439 \u0441\u0432\u044F\u0437\u0438, \u0447\u0442\u043E\u0431\u044B \u0440\u0430\u0437\u0433\u0440\u0443\u0437\u0438\u0442\u044C \u043D\u0430\u0448\u0438\u0445 \u043C\u0435\u043D\u0435\u0434\u0436\u0435\u0440\u043E\u0432 \u043E\u0442 \u043E\u0431\u0440\u0430\u0431\u043E\u0442\u043A\u0438 \u0441\u043F\u0435\u0446\u0438\u0444\u0438\u0447\u0435\u0441\u043A\u0438\u0445, \u043B\u0438\u0431\u043E \u043D\u0435\u043F\u0440\u043E\u0444\u0438\u043B\u044C\u043D\u044B\u0445\r\n                    \u0432\u043E\u043F\u0440\u043E\u0441\u043E\u0432, \u0438 \u0441\u043E\u0441\u0440\u0435\u0434\u043E\u0442\u043E\u0447\u0438\u0442\u0441\u044F \u043D\u0430 \u0434\u0430\u043B\u044C\u043D\u0435\u0439\u0448\u0435\u043C \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u0438 \u043D\u0430\u0448\u0435\u0433\u043E \u043F\u043E\u0440\u0442\u0430\u043B\u0430, \u043C\u044B \u0441\u043E\u0437\u0434\u0430\u043B\u0438 \u0441\u0435\u0440\u0432\u0438\u0441 \u044E\u0440\u0438\u0434\u0438\u0447\u0435\u0441\u043A\u043E\u0433\u043E\r\n                    \u043A\u043E\u043D\u0441\u0443\u043B\u044C\u0442\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F, \u0440\u0430\u0431\u043E\u0442\u0430\u044E\u0449\u0438\u0439 \u043D\u0430 \u043F\u043B\u0430\u0442\u043D\u043E\u0439 \u043E\u0441\u043D\u043E\u0432\u0435.",
              "data4": "\u0412 \u0441\u043B\u0443\u0447\u0430\u0435 \u0435\u0441\u043B\u0438 \u0412\u0430\u0448 \u0437\u0430\u043F\u0440\u043E\u0441, \u0442\u0440\u0435\u0431\u0443\u0435\u0442 \u0434\u043E\u043F\u043E\u043B\u043D\u0438\u0442\u0435\u043B\u044C\u043D\u043E\u0439 \u043E\u0431\u0440\u0430\u0431\u043E\u0442\u043A\u0438, \u0438 \u0438\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0438\u044F \u043F\u043E \u043D\u0435\u043C\u0443 \u043D\u0430 \u043F\u043E\u0440\u0442\u0430\u043B\u0435\r\n                    \u043E\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442, \u043D\u0430\u0448 \u043C\u0435\u043D\u0435\u0434\u0436\u0435\u0440, \u043F\u0440\u0435\u0434\u043B\u043E\u0436\u0438\u0442 \u0432\u0430\u043C \u0438\u0437\u043B\u043E\u0436\u0438\u0442\u044C \u0441\u0432\u043E\u0439 \u0437\u0430\u043F\u0440\u043E\u0441 \u043F\u0438\u0441\u044C\u043C\u0435\u043D\u043D\u043E \u0438 \u043F\u043E\u0441\u043B\u0435 \u0435\u0433\u043E \u0438\u0437\u0443\u0447\u0435\u043D\u0438\u044F,\r\n                    \u0441\u043E\u043E\u0431\u0449\u0438\u0442 \u0412\u0430\u043C \u0441\u0442\u043E\u0438\u043C\u043E\u0441\u0442\u044C, \u0441\u0440\u043E\u043A\u0438 \u0432\u044B\u043F\u043E\u043B\u043D\u0435\u043D\u0438\u044F \u0438 \u043F\u043E\u0440\u044F\u0434\u043E\u043A \u043E\u043F\u043B\u0430\u0442\u044B.",
